<!DOCTYPE html>
<meta charset="utf-8">
<style>
body {
  font: 10px sans-serif;
}
.group-tick line {
  stroke: #000;
}
.current line {
    fill: red;
    stroke: black;
}
.ribbons {
  fill-opacity: 0.67;
}
</style>
<svg width="960" height="960"></svg>
<script src="https://d3js.org/d3.v4.min.js"></script>
<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.1.0/jquery.min.js"></script>
<script src="cursor.js"></script>

var matrix = [];
$.getJSON( "matrix.json", function( data ) {
  matrix = data;

  var svg = d3.select("svg"),
      width = +svg.attr("width"),
      height = +svg.attr("height"),
      outerRadius = Math.min(width, height) * 0.5 - 40,
      innerRadius = outerRadius - 30;
  var formatValue = d3.formatPrefix(",.0", 1e3);
  var chord = d3.chord()
      .padAngle(0.05)
      .sortSubgroups(d3.descending);
  var arc = d3.arc()
      .innerRadius(innerRadius)
      .outerRadius(outerRadius);
  var ribbon = d3.ribbon()
      .radius(innerRadius);
  var color = d3.scaleOrdinal()
      .domain(d3.range(4))
      .range(["#000000", "#FFDD89", "#957244", "#F26223"]);
  var g = svg.append("g")
      .attr("transform", "translate(" + width / 2 + "," + height / 2 + ")")
      .datum(chord(matrix));
  var group = g.append("g")
      .attr("class", "groups")
    .selectAll("g")
    .data(function(chords) { return chords.groups; })
    .enter().append("g");
  group.append("path")
      .style("fill", function(d) { return color(d.index); })
      .style("stroke", function(d) { return d3.rgb(color(d.index)).darker(); })
      .attr("d", arc);
  var groupTick = group.selectAll(".group-tick")
    .data(function(d) { return groupTicks(d, 1e3); })
    .enter().append("g")
      .attr("class", "group-tick")
      .attr("class", "current")
      .attr("transform", function(d) { return "rotate(" + (d.angle * 180 / Math.PI - 90) + ") translate(" + outerRadius + ",0)"; });
  groupTick.append("line")
      .attr("x2", 6);
  groupTick
    .filter(function(d) { return d.value % 5e3 === 0; })
    .append("text")
      .attr("x", 8)
      .attr("dy", ".35em")
      .attr("transform", function(d) { return d.angle > Math.PI ? "rotate(180) translate(-16)" : null; })
      .style("text-anchor", function(d) { return d.angle > Math.PI ? "end" : null; })
      .text(function(d) { return formatValue(d.value); });
  g.append("g")
      .attr("class", "ribbons")
    .selectAll("path")
    .data(function(chords) { return chords; })
    .enter().append("path")
      .attr("d", ribbon)
      .style("fill", function(d) { return color(d.target.index); })
      .style("stroke", function(d) { return d3.rgb(color(d.target.index)).darker(); });
  // Returns an array of tick angles and values for a given group and step.
  function groupTicks(d, step) {
    var k = (d.endAngle - d.startAngle) / d.value;
    return d3.range(0, d.value, step).map(function(value) {
      return {value: value, angle: value * k + d.startAngle};
    });
  }
});

<script>
// every 1 second, move the cursor to the next group tick
$(function() {
    var ticks = document.getElementsByClassName('group-tick');
    let i = 0;
    let j = 0;
    while(j < 100) {
        let current = ticks[i];
        console.log('added current to ' + i);
        current.addClass('current');
        var currentLine = document.getElementByClass('current');
        currentLine.firstElementChild.setAttribute('x2', 1000);
        setTimeout(function(){}, 1000);

        currentLine.firstElementChild.setAttribute('x2', 6);
        console.log('removed current from ' + i);
        i = (i + 1) % 4;
        j++;
    }
});
</script>
